pragma solidity >=0.4.21 <0.7.0;

// It's important to avoid vulnerabilities due to numeric overflow bugs
// OpenZeppelin's SafeMath library, when used correctly, protects agains such bugs
// More info: https://www.nccgroup.trust/us/about-us/newsroom-and-events/blog/2018/november/smart-contract-insecurity-bad-arithmetic/

import "./SafeMath.sol";
import "./IsOperational.sol";

/************************************************** */
/* FlightSurety Smart Contract                      */
/************************************************** */
contract FlightSuretyApp is IsOperational {
    using SafeMath for uint256; // Allow SafeMath functions to be called for all uint256 types (similar to "prototype" in Javascript)

    /********************************************************************************************/
    /*                                       DATA VARIABLES                                     */
    /********************************************************************************************/

    // Flight status codees
    uint8 private constant STATUS_CODE_UNKNOWN = 0;
    uint8 private constant STATUS_CODE_ON_TIME = 10;
    uint8 private constant STATUS_CODE_LATE_AIRLINE = 20;
    uint8 private constant STATUS_CODE_LATE_WEATHER = 30;
    uint8 private constant STATUS_CODE_LATE_TECHNICAL = 40;
    uint8 private constant STATUS_CODE_LATE_OTHER = 50;

    address _flightDataContractAddress;
    FlightSuretyData flightSuretyData;


    /********************************************************************************************/
    /*                                       CONSTRUCTOR                                        */
    /********************************************************************************************/

    /**
    * @dev Contract constructor
    *
    */
    constructor(address flightDataContractAddress)
    IsOperational(msg.sender, "App")
    public
    {
        _flightDataContractAddress = flightDataContractAddress;
        flightSuretyData = FlightSuretyData(flightDataContractAddress);
    }

   /**
    * @dev Add an airline to the registration queue
    *
    */   
    function registerAirline(string calldata airlineCode)
    external
    returns(bool success, uint256 votes)
    {
        flightSuretyData.registerAirline(msg.sender, airlineCode);
        return (true, 1);
    }


   /**
    * @dev Register a future flight for insuring.
    *
    */
    function registerFlight(string calldata airlineCode, uint256 timestamp)
    requireIsOperational
    external
    {
        bytes32 flightKey =  getFlightKey(msg.sender, airlineCode, timestamp);
        flightSuretyData.addFlight(msg.sender, flightKey, timestamp);
    }

   /**
    * @dev Called after oracle has updated flight status
    *
    */  
    function processFlightStatus(address airline, string memory flight, uint256 timestamp, uint8 statusCode) internal
    {
        bytes32 flightKey = getFlightKey(airline, flight, timestamp);
       flightSuretyData.updateFlightStatus(flightKey, timestamp, statusCode);
    }

    // Generate a request for oracles to fetch flight information
    function fetchFlightStatus
                        (
                            address airline,
                            string calldata flight,
                            uint256 timestamp
                        )
                        external
    {
        uint8 index = getRandomIndex(msg.sender);

        // Generate a unique key for storing the request
        bytes32 key = keccak256(abi.encodePacked(index, airline, flight, timestamp));
        oracleResponses[key] = ResponseInfo({
                                                requester: msg.sender,
                                                isOpen: true
                                            });

        emit OracleRequest(index, airline, flight, timestamp);
    }

    function fund()
    public
    payable
    {
        address(this).transfer(msg.value);
        address(uint160(_flightDataContractAddress)).transfer(msg.value);
    }


// region ORACLE MANAGEMENT

    // Incremented to add pseudo-randomness at various points
    uint8 private nonce = 0;    

    // Fee to be paid when registering oracle
    uint256 public constant REGISTRATION_FEE = 1 ether;

    // Number of oracles that must respond for valid status
    uint256 private constant MIN_RESPONSES = 0;


    struct Oracle {
        bool isRegistered;
        uint8[3] indexes;        
    }

    // Track all registered oracles
    mapping(address => Oracle) private oracles;

    // Model for responses from oracles
    struct ResponseInfo {
        address requester;                              // Account that requested status
        bool isOpen;                                    // If open, oracle responses are accepted
        mapping(uint8 => address[]) responses;          // Mapping key is the status code reported
                                                        // This lets us group responses and identify
                                                        // the response that majority of the oracles
    }

    // Track all oracle responses
    // Key = hash(index, flight, timestamp)
    mapping(bytes32 => ResponseInfo) private oracleResponses;

    // Event fired each time an oracle submits a response
    event FlightStatusInfo(address airline, string flight, uint256 timestamp, uint8 status);

    event OracleReport(address airline, string flight, uint256 timestamp, uint8 status);

    // Event fired when flight status request is submitted
    // Oracles track this and if they have a matching index
    // they fetch data and submit a response
    event OracleRequest(uint8 index, address airline, string flight, uint256 timestamp);


    // Register an oracle with the contract
    function registerOracle()
    external
    payable
    {
        // Require registration fee
        require(msg.value >= REGISTRATION_FEE, "Registration fee is required");

        uint8[3] memory indexes = generateIndexes(msg.sender);

        oracles[msg.sender] = Oracle({
                                        isRegistered: true,
                                        indexes: indexes
                                    });
    }

    function getMyIndexes()
    view
    external
    returns(uint8[3] memory)
    {
        require(oracles[msg.sender].isRegistered, "Not registered as an oracle");

        return oracles[msg.sender].indexes;
    }


    // Called by oracle when a response is available to an outstanding request
    // For the response to be accepted, there must be a pending request that is open
    // and matches one of the three Indexes randomly assigned to the oracle at the
    // time of registration (i.e. uninvited oracles are not welcome)
    function submitOracleResponse(
        uint8 index,
        address airline,
        string calldata flight,
        uint256 timestamp,
        uint8 statusCode)
    external
    {
        require((oracles[msg.sender].indexes[0] == index) || (oracles[msg.sender].indexes[1] == index) || (oracles[msg.sender].indexes[2] == index), "Index does not match oracle request");


        bytes32 key = keccak256(abi.encodePacked(index, airline, flight, timestamp)); 
        require(oracleResponses[key].isOpen, "Flight or timestamp do not match oracle request");

        oracleResponses[key].responses[statusCode].push(msg.sender);

        // Information isn't considered verified until at least MIN_RESPONSES
        // oracles respond with the *** same *** information
        emit OracleReport(airline, flight, timestamp, statusCode);
        if (oracleResponses[key].responses[statusCode].length >= MIN_RESPONSES) {

            emit FlightStatusInfo(airline, flight, timestamp, statusCode);

            // Handle flight status as appropriate
            processFlightStatus(airline, flight, timestamp, statusCode);
        }
    }


    function getFlightKey(
        address airline,
        string memory flight,
        uint256 timestamp)
    internal
    pure
    returns(bytes32)
    {
        return keccak256(abi.encodePacked(airline, flight, timestamp));
    }

    // Returns array of three non-duplicating integers from 0-9
    function generateIndexes(address account)
    internal
    returns(uint8[3] memory)
    {
        uint8[3] memory indexes;
        indexes[0] = getRandomIndex(account);

        indexes[1] = indexes[0];
        while(indexes[1] == indexes[0]) {
            indexes[1] = getRandomIndex(account);
        }

        indexes[2] = indexes[1];
        while((indexes[2] == indexes[0]) || (indexes[2] == indexes[1])) {
            indexes[2] = getRandomIndex(account);
        }

        return indexes;
    }

    // Returns array of three non-duplicating integers from 0-9
    function getRandomIndex(address account)
                            internal
                            returns (uint8)
    {
        uint8 maxValue = 10;

        // Pseudo random number...the incrementing nonce adds variation
        uint8 random = uint8(uint256(keccak256(abi.encodePacked(blockhash(block.number - nonce++), account))) % maxValue);

        if (nonce > 250) {
            nonce = 0;  // Can only fetch blockhashes for last 256 blocks so we adapt
        }

        return random;
    }

    function creditInsurees()
    external
    requireIsOperational
    {
        flightSuretyData.creditInsurees();
    }

    function payPassenger()
    external
    payable
    requireIsOperational
    {
        flightSuretyData.pay(msg.sender);
    }

    function approveAirline(address airline)
    requireIsOperational
    external
    {
        flightSuretyData.approveAirline(msg.sender, airline);
    }

    function payRegistrationFee()
    external
    payable
    {
        require(msg.value >= 10 ether, "Amount needed to register is 10 ether");
        require(address(this).balance > 10, "Should have enough balance");
        address(uint160(_flightDataContractAddress)).transfer(10 ether);
        flightSuretyData.payRegistrationFee(msg.sender);
        msg.sender.transfer(msg.value - 10 ether);
    }

    // READ Data Functions

    function getPassengerInsurances()
    external
    view
    returns(bytes32[] memory)
    {
        return flightSuretyData.getPassengerInsurances(msg.sender);
    }

    function getPassengerInsurance(bytes32 flightIdentifier)
    external
    view
    returns(uint256, uint8)
    {
        return flightSuretyData.getPassengerInsurance(msg.sender, flightIdentifier);
    }

    function getPassengerCredit()
    external
    view
    returns(uint256)
    {
        return flightSuretyData.getPassengerCredit(msg.sender);
    }


    function getFlights()
    external
    view
    returns(bytes32[] memory)
    {
        return flightSuretyData.getFlights();
    }

    function getFlightInfo(bytes32 flightIdentifier)
    external
    view
    returns(address airlineAddress, bytes32, uint8, uint256)
    {
        return flightSuretyData.getFlightInfo(flightIdentifier);
    }

    function getAllAirlines()
    external
    view
    returns(address[] memory)
    {
        return flightSuretyData.getAllAirlines();
    }

    function getAirlineInfo()
    external
    view
    returns(address airlineAddress, uint8 status, string memory airlineCode, uint256 approvalsNeeded, uint256 totalApprovals)
    {
        return flightSuretyData.getAirlineInfo(msg.sender);
    }

    function claimPassengerInsurance(bytes32 flightKey)
    external
    requireIsOperational
    {
        flightSuretyData.claimInsurance(msg.sender, flightKey);
    }

    function buyInsurance(bytes32 flightKey, uint256 amount)
    external
    payable
    {
        flightSuretyData.buyInsuranceInternal(msg.sender, flightKey, amount);
    }

    function()
    payable
    external
    {

    }

}

contract FlightSuretyData {

    // credits all the funds for insurees
    function creditInsurees() payable external;

    // AIRLINES

    // payouts a passenger remaining credit
    function pay(address passengerAddress) payable external;
    // register an airline
    function registerAirline(address airlineAddress, string calldata airlineCode) external;
    // add a flight for the airline
    function addFlight(address airlineAddress, bytes32 flightIdentifier, uint256 timestamp) external;
    // update the flight status
    function updateFlightStatus(bytes32 flightIdentifier, uint256 timestamp, uint8 statusCode) external;
    // check if the given flight is a valid flight
    function isValidFlight(bytes32 flightIdentifier, uint256 timestamp) public view returns(bool);
    // method to pay registration fee
    function payRegistrationFee(address airlineAddress) external;
    // an airline tries to approve another airline
    function approveAirline(address airlineAddress, address newAirlineAddress) external;
    // gets all flights keys
    function getFlights() external view returns(bytes32[] memory);
    // gets the info of a flight
    function getFlightInfo(bytes32 flightIdentifier) external view returns(address, bytes32, uint8, uint256);
    // get all airline addresses
    function getAllAirlines() external view returns(address[] memory);
    // get airline info
    function getAirlineInfo(address airlineAddress) external view returns(address, uint8, string memory, uint256, uint256);

    // PASSENGERS

    // passenger can buy insurance using this method
    function buyInsuranceInternal(address passengerAddress, bytes32 flightIdentifier, uint256 amount) external payable;
    // passenger can claim insurance for a flight
    function claimInsurance(address passengerAddress, bytes32 flightIdentifier) external;
    // get all passenger insurances addresses
    function getPassengerInsurances(address passengerAddress) external view returns(bytes32[] memory);
    // gets a passenger insurance in details
    function getPassengerInsurance(address passengerAddress, bytes32 flightIdentifier) external view returns(uint256, uint8);
    // get outstanding amount for a passenger
    function getPassengerCredit(address passengerAddress) external view returns(uint256);
}
